import React, { useEffect } from "react";
import { styled } from "@mui/material/styles";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell, { tableCellClasses } from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import { useDispatch, useSelector } from "react-redux";
import { deleteUsers, loadUsers } from "./../redux/actions";
import { Button, ButtonGroup } from "@mui/material";
import { display, margin } from "@mui/system";
import { useNavigate } from "react-router-dom";
import { addAndDeleteProductInCart, getCart } from "redux/cart-actions";

// const useStyles = makeStyles((theme) => {
//   root: {
//     display: "flex";
//     flexDirection: "column";
//     alignItems: "center";
//     '&>*':
//       {
//         margin: theme.spacing(1),
//       };
//   }
// });

const MainPage = () => {
  //   const buttonStyles = useStyles();

  const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
      backgroundColor: theme.palette.common.black,
      color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
      fontSize: 14,
    },
  }));

  const StyledTableRow = styled(TableRow)(({ theme }) => ({
    "&:nth-of-type(odd)": {
      backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    "&:last-child td, &:last-child th": {
      border: 0,
    },
  }));

  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }

  //   const rows = [
  //     createData("Frozen yoghurt", 159, 6.0, 24, 4.0),
  //     createData("Ice cream sandwich", 237, 9.0, 37, 4.3),
  //     createData("Eclair", 262, 16.0, 24, 6.0),
  //     createData("Cupcake", 305, 3.7, 67, 4.3),
  //     createData("Gingerbread", 356, 16.0, 49, 3.9),
  //   ];

  //
  let dispatch = useDispatch();
  const { users } = useSelector((state) => state.data);
  const { cart } = useSelector((state) => state);
  useEffect(() => {
    dispatch(loadUsers());
    dispatch(getCart());
  }, []);
  const handleDelete = (id) => {
    if (window.confirm("Are you sure wanted to delete the user?")) {
      dispatch(deleteUsers(id));
    }
  };
  let navigate = useNavigate();
  const handleAddAndDeleteProductInCart = (product) => {
    dispatch(addAndDeleteProductInCart(product));
  };
  return (
    <div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <Button
          style={{ margin: "50px" }}
          onClick={() => navigate("/addUser")}
          variant="contained"
          color="primary"
        >
          Add book
        </Button>
      </div>

      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 700 }} aria-label="customized table">
          <TableHead>
            <TableRow>
              <StyledTableCell>Name</StyledTableCell>
              <StyledTableCell align="center">Image</StyledTableCell>
              <StyledTableCell align="center">Contact</StyledTableCell>
              <StyledTableCell align="center">Author</StyledTableCell>
              <StyledTableCell align="center">Category</StyledTableCell>
              <StyledTableCell align="center">Action</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {users &&
              users.map((user) => (
                <StyledTableRow key={user.id}>
                  <StyledTableCell component="th" scope="row">
                    {user.name}
                  </StyledTableCell>
                  <StyledTableCell align="center">
                    <img
                      style={{ width: "200px", height: "200px" }}
                      src={user.image}
                      alt=""
                    />
                  </StyledTableCell>
                  <StyledTableCell align="center">
                    {user.contact}
                  </StyledTableCell>
                  <StyledTableCell align="center">
                    {user.address}
                  </StyledTableCell>
                  <StyledTableCell align="center">
                    {user.category}
                  </StyledTableCell>

                  <StyledTableCell align="center">
                    <ButtonGroup
                      variant="container"
                      aria-label="contained
                      primary
                      button group"
                    >
                      <Button
                        style={{ background: "red" }}
                        color="secondary"
                        onClick={() => handleDelete(user.id)}
                      >
                        Delete
                      </Button>
                      <Button
                        style={{ background: "blue" }}
                        color="primary"
                        onClick={() => navigate(`/editUser/${user.id}`)}
                      >
                        Edit
                      </Button>

                      <Button
                        style={{ background: "green" }}
                        color="primary"
                        onClick={() => handleAddAndDeleteProductInCart(user)}
                      >
                        Add to cart
                      </Button>
                    </ButtonGroup>
                  </StyledTableCell>
                </StyledTableRow>
              ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default MainPage;
